<section>
    <div class=""category-outro-block text-center"">
        <div class=""inner"">
            <h3><i><b>Earrings</b></i></h3>
            <p>
                You heard it here first, a new pair of statement earrings makes the ultimate adornment.
                If you’ve been thinking about treating yourself or someone special to some new everyday hoops,
                minimalist studs or statement drops, these bestselling earrings are a great place to start;
                designed to go with everything, they’ll make opulent additions to any jewellery collection.
                From diamond studs to dramatic gemstone drops, few things are more transformative and face framing than earrings.
                Ideal for occasions and daily wear, our fine and demi-fine earrings make unique gift ideas and are certain to raise smiles.
                Whatever your ear party approach, choose from our radiant selection of earrings that can be stacked high or worn alone.");
            WriteLiteral(@"
                Every pair of Astley Clarke earrings is designed in our London studio, with emphasis on creating meaningful pieces
                that can be effortlessly mixed and matched together, to represent your own personal style. We work exclusively with noble metals,
                natural ethically sourced diamonds and responsibly sourced gemstones, taking great care to craft our jewellery
                so that it will last and be loved for years to come. Available with free global delivery and free returns for the UK, USA and Europe,
                plus luxury gift wrapping.
            </p>
